import React, { Children } from 'react';
import classes from './MyButton.module.css'

const MyBotton = ({children, visible, ...props}) => {
    const rootClassesImg = []
    const rootClassesText = [classes.text]
    if (visible) {
        rootClasses.push(classes.img);
        rootClassesText.pop.push(classes.textWithIcon)
    }

    return (
        <button {...props} className={classes.myBtn} >
          <div className={rootClasses}></div>
          <p className={classes.text}>{children}</p>
        </button>
    );
};

export default MyBotton;
